import { useState, useEffect } from "react";

function Home() {
  const [time, setTime] = useState(new Date());

  useEffect(() => {
    const id = setInterval(() => {
      setTime(new Date());
    }, 1000);
    return () => clearInterval(id);
  }, []);

  return (
    <div>
      <h1>Clock</h1>
      <span>{time.toLocaleTimeString()}</span>
    </div>
  );
}

export default Home;
